import React from "react";
import Item from "../comps/item";

const ItemList = props => {
  return (
    <div>
      {props.items.map((item, index) => (
        <Item key={item.id} title={item.title} type={item.type}></Item>
      ))}
    </div>
  );
};

export default ItemList;
